import React, { Component } from 'react'

export default class InsertData extends Component {


    constructor(par) {
        super()
        this.state={
            // task:
            //     {
            //         'task':'',
            //          'status':'',
    
            //     }
            task:'',
            status:'',
            
        }
        this.SaveData=this.SaveData.bind('this');
        this.HandelChange=this.HandelChange.bind('this');


    }

    handelChange(e){
        const key = e.target.name
        const value = e.target.value
        this.setState({ key : value})
        
        //console.log()
    }
    SaveData(){

    }


    render() {
        return (
            <div>
                <form method="post" onSubmit={this.SaveData} >
                <div className="form-group row">
                    <div className="col-md-3">
                        <h5>Your Task </h5>

                    </div>

                    <div className="col">
                        <input type="text" onChange={this.handelChange} name="task" id="" className="form-control" placeholder="" aria-describedby="helpId" />

                    </div>

                </div>
                <div className="row">
                    <div className="col-md-3">
                        <h5>Task Status</h5>

                    </div>

                    <div className="col">
                        <input type="text" name="status"  onChange={this.handelChange} id="" className="form-control" placeholder="" aria-describedby="helpId" />

                    </div>
                </div> <br/>
                <div className="btn-group col-md-2 offset-md-4" role="group" aria-label="">
                    <button type="button" className="btn btn-primary">Save</button>
                </div>
                </form>
                {this.state.task}
            </div>
        )
    }
}
